<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div><div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>En complemento con la informacin proporcionada en otros elementos de la pgina web. Es posible observar que:</p>
<ul>
<li><p>En general, los estados del norte cuentan con niveles ms altos de acceso a trabajo remunerado, mientras que los del sureste se destacan por lo contrario. La Ciudad de Mxico destaca por sus altos niveles en ambas variables</p>
</li>
<li><p>En cuanto al ndice de Gini, se identific mayor presencia de desigualdad en los estados del sureste que en los del norte</p>
</li>
<li><p>La tasa de misoginia mostr niveles altos en prcticamente casi todo el pas. Sin embargo, destacan estados como Veracruz, Tamaulipas, Campeche, Sonora, Sinaloa y Nayarit. En contraposicin, se encuentran estados como Baja California, Zacatecas, Aguascalientes, Ciudad de Mxico, Morelos, Oaxaca y Quintana Roo. De manera general, el norte revel la presencia de un mayor nmero de tweets misginos</p>
</li>
<li><p>En el caso de los feminicidios, en trminos generales, los datos producidos por el Seretariado y la prensa no son tan dismiles, aunque muestran mayor cantidad de registros, los correspondientes a datos de la prensa. Igualmente, puede notarse una tendencia en los casos de feminicidios en la zona centro - sur del pas</p>
</li>
</ul>

</div>
</div>
</div>
