<p>Se detect una correlacin entre variables que vale la pena destar: acceso a trabajo remunerado y grado de escolaridad. La correlacin es positiva, por lo que se supone que a mayor grado de escolaridad mayores posibilidades de acceder a trabajo remunerado</p>

